import React from "react";
import PlayerInfo from "./components/PlayerInfo";

const App = () => {
  // Sample player data
  const players = [
    { name: "Alice", token: "Car", balance: 1500 },
    { name: "Bob", token: "Hat", balance: 1200 },
    { name: "Charlie", token: "Dog", balance: 800 },
  ];

  return (
    <div style={{ padding: "20px" }}>
      <h1>Monopoly Game Players</h1>
      {players.map((player, index) => (
        <PlayerInfo
          key={index}
          name={player.name}
          token={player.token}
          balance={player.balance}
        />
      ))}
    </div>
  );
};

export default App;
